Radium_Compressor::Radium_Compressor (Patch *patch)
    : patch (patch),
      attack_slider (0),
      release_slider (0),
      bypass_button (0),
      hyperlinkButton (0)
{
    addAndMakeVisible (attack_slider = new MySlider ("new slider"));
    attack_slider->setRange (0, 500, 0);
    attack_slider->setSliderStyle (Slider::LinearBar);
    attack_slider->setTextBoxStyle (Slider::TextBoxLeft, true, 80, 20);
    attack_slider->setColour (Slider::thumbColourId, Colour (0x6a151525));
    attack_slider->setColour (Slider::trackColourId, Colour (0x1affffff));
    attack_slider->setColour (Slider::rotarySliderOutlineColourId, Colour (0xff614141));
    attack_slider->setColour (Slider::textBoxTextColourId, Colour (0xff030611));
    attack_slider->setColour (Slider::textBoxBackgroundColourId, Colour (0x73462828));
    attack_slider->addListener (this);
    attack_slider->setSkewFactor (0.5);

    addAndMakeVisible (release_slider = new MySlider ("new slider"));
    release_slider->setRange (0, 500, 0);
    release_slider->setSliderStyle (Slider::LinearBar);
    release_slider->setTextBoxStyle (Slider::TextBoxLeft, true, 80, 20);
    release_slider->setColour (Slider::thumbColourId, Colour (0x25bbbbff));
    release_slider->setColour (Slider::trackColourId, Colour (0x1affffff));
    release_slider->setColour (Slider::textBoxTextColourId, Colour (0xec000000));
    release_slider->setColour (Slider::textBoxBackgroundColourId, Colour (0x73ffffff));
    release_slider->addListener (this);
    release_slider->setSkewFactor (0.5);

    addAndMakeVisible (bypass_button = new ToggleButton ("new toggle button"));
    bypass_button->setButtonText ("Bypass");
    bypass_button->setConnectedEdges (Button::ConnectedOnLeft | Button::ConnectedOnRight | Button::ConnectedOnTop | Button::ConnectedOnBottom);
    bypass_button->addListener (this);
    bypass_button->setColour (ToggleButton::textColourId, Colour (0xff042961));

    addAndMakeVisible (hyperlinkButton = new HyperlinkButton ("Radium",
                                                              URL ("http://users.notam02.no/~kjetism/radium/")));
    hyperlinkButton->setTooltip ("http://users.notam02.no/~kjetism/radium/");
    hyperlinkButton->setButtonText ("Radium");


    //[UserPreSize]

#if BUILD_DEMO
    show_demo_text = false;
    demo_text_timer.init(this);
#endif

    attack_slider->patch = patch;
    attack_slider->effect_num = COMP_EFF_ATTACK;
    attack_slider->slider_name = "Attack";

    release_slider->patch = patch;
    release_slider->effect_num = COMP_EFF_RELEASE;
    release_slider->slider_name = "Release";

    init_colors();

    comp = new custom_gui::cvs::Comp(patch,NULL);
    //printf("making visible %p\n",&comp->w);
    addAndMakeVisible(&comp->w);

    //printf("making visible %p\n",&comp->w);
    //addAndMakeVisible(new vertical_sliders::Vertical_Sliders());
    //[/UserPreSize]

    setSize (500, 500);


    //[Constructor] You can add your own custom stuff here..
    slider_updater = new su::SliderUpdater(this);
    //[/Constructor]
}

Radium_Compressor::~Radium_Compressor()
{
    //[Destructor_pre]. You can add your own custom destruction code here..

  delete slider_updater;

    //[/Destructor_pre]

    deleteAndZero (attack_slider);
    deleteAndZero (release_slider);
    deleteAndZero (bypass_button);
    deleteAndZero (hyperlinkButton);


    //[Destructor]. You can add your own custom destruction code here..

  delete comp;

    //[/Destructor]
}

