{
    attack_slider->setBounds (8, 350, 408, 24);
    release_slider->setBounds (8, 382, 408, 24);
    bypass_button->setBounds (8, 8, 72, 24);
    hyperlinkButton->setBounds (352, 8, 72, 24);
    //[UserResized] Add your own custom resize handling here..

    int y = bypass_button->getY() + bypass_button->getHeight() + 4;
    comp->w.setBounds (attack_slider->getX(),y,
                       attack_slider->getWidth() + 4,attack_slider->getY()-y-6);

    //[/UserResized]
}

